const CharactersSearch = (props) => {
  return (
    <form className='main__form'>
      <CharactersSearch
        searchName={props.searchName}
        handleSearchName={props.handleSearchName}
        filterSpecies={props.filterSpecies}
        handleFilterSpecies={props.handleFilterSpecies}
      />
      <section className='main__form--section'>
        <props.CharactersList data={props.filteredData} />
      </section>
    </form>
  );
};
export default CharactersSearch;
